import{_ as a,c as e,o as r,a4 as t}from"./chunks/framework.BS0dEra9.js";const b=JSON.parse('{"title":"皮特174，apex主播，职业选手","description":"","frontmatter":{},"headers":[],"relativePath":"pite/index.md","filePath":"pite/index.md"}'),h={name:"pite/index.md"},i=t('<h1 id="皮特174-apex主播-职业选手" tabindex="-1">皮特174，apex主播，职业选手 <a class="header-anchor" href="#皮特174-apex主播-职业选手" aria-label="Permalink to &quot;皮特174，apex主播，职业选手&quot;">​</a></h1><h2 id="_1" tabindex="-1">1. <a class="header-anchor" href="#_1" aria-label="Permalink to &quot;1.&quot;">​</a></h2><p>皮特 听说你昨晚跟你老丈人吃猪头肉 你老丈人没戴眼镜.一筷子夹你脸上了</p><h2 id="_2" tabindex="-1">2. <a class="header-anchor" href="#_2" aria-label="Permalink to &quot;2.&quot;">​</a></h2><p>皮神，黑你的人太多我举报不过来，我直接举报直播间端了他们的老窝</p><h2 id="_3" tabindex="-1">3. <a class="header-anchor" href="#_3" aria-label="Permalink to &quot;3.&quot;">​</a></h2><p>主播我帮你引流了，刚才我点了两下举报，他说会有人持续关注你</p><h2 id="_4" tabindex="-1">4. <a class="header-anchor" href="#_4" aria-label="Permalink to &quot;4.&quot;">​</a></h2><p>斗鱼真是越来越难用了，我明明调的最大亮度，主播的操作还是让我两眼一黑</p><h2 id="_5" tabindex="-1">5. <a class="header-anchor" href="#_5" aria-label="Permalink to &quot;5.&quot;">​</a></h2><p>看了一下，这里很多带节奏的弹幕都是戴的狂野皮的牌子，这是哪个低素质主播的粉丝</p><h2 id="_6" tabindex="-1">6. <a class="header-anchor" href="#_6" aria-label="Permalink to &quot;6.&quot;">​</a></h2><p>《世界第七》《我们不要直邀》《靠两周第二》《靠区决》《靠直邀》《jk点的什么面》</p><h2 id="_7" tabindex="-1">7. <a class="header-anchor" href="#_7" aria-label="Permalink to &quot;7.&quot;">​</a></h2><p>我问大师皮特的枪法怎么样，大师指了旁边沸腾的铁壶，我问大师：开了？大师说：铁沸物</p><h2 id="_8" tabindex="-1">8. <a class="header-anchor" href="#_8" aria-label="Permalink to &quot;8.&quot;">​</a></h2><p>《重生之我是皮特》《怎么在猪圈》《3MZ也在》《哈哈他没我肥》《卧槽，过年了》</p><h2 id="_9" tabindex="-1">9. <a class="header-anchor" href="#_9" aria-label="Permalink to &quot;9.&quot;">​</a></h2><p>进这个直播间就像到了女厕所一样，全是姐妹们一起在蹲蹲，还有主播端个碗在那说拉满。</p><h2 id="_10" tabindex="-1">10. <a class="header-anchor" href="#_10" aria-label="Permalink to &quot;10.&quot;">​</a></h2><p>卧槽主播你小点声，我家母🐖听到了以为要给它配种，现在疯狂拱门</p><h2 id="_11" tabindex="-1">11. <a class="header-anchor" href="#_11" aria-label="Permalink to &quot;11.&quot;">​</a></h2><p>昨天吃的金针菇 等了1天没拉 就是为了今天晚上让皮特体验螺旋缠绕感</p><h2 id="_12" tabindex="-1">12. <a class="header-anchor" href="#_12" aria-label="Permalink to &quot;12.&quot;">​</a></h2><p>压力，吸血，垫底你和卫生巾唯一的区别就是没有逼用</p><h2 id="_13" tabindex="-1">13. <a class="header-anchor" href="#_13" aria-label="Permalink to &quot;13.&quot;">​</a></h2><p>想做皮特的鼠标，这样皮特就能按压我的两瓣，不停的拨弄我中间的豆豆</p><h2 id="_14" tabindex="-1">14. <a class="header-anchor" href="#_14" aria-label="Permalink to &quot;14.&quot;">​</a></h2><p>还搁这直播呢？观音菩萨交代你的事忘了？唐僧都出发了，孙悟空满高老庄找你呢</p><h2 id="_15" tabindex="-1">15. <a class="header-anchor" href="#_15" aria-label="Permalink to &quot;15.&quot;">​</a></h2><p>自从夸了主播，早起莲台身下坐，高僧给我贴金箔，猴王见我直认错，乐山找我当大佛</p><h2 id="_16" tabindex="-1">16. <a class="header-anchor" href="#_16" aria-label="Permalink to &quot;16.&quot;">​</a></h2><p>队友失误疯狂喊叫😡，自己打错轻声尬笑😋，各种操作莫名其妙🤔，我叫皮特非常搞笑</p><h2 id="_17" tabindex="-1">17. <a class="header-anchor" href="#_17" aria-label="Permalink to &quot;17.&quot;">​</a></h2><p>皮特先辈，十分高贵。落地就倒，一碰就碎。除了虐菜，啥也不会。唐得要死，硬说点背</p><h2 id="_18" tabindex="-1">18. <a class="header-anchor" href="#_18" aria-label="Permalink to &quot;18.&quot;">​</a></h2><p>我在“不骂主播”活动中坚持了5秒，获得称号“十世善人”，你也来参加吧！</p><h2 id="_19" tabindex="-1">19. <a class="header-anchor" href="#_19" aria-label="Permalink to &quot;19.&quot;">​</a></h2><p>《指出我的问题》《我有什么问题》《这也算是问题？》《你哪来这么多问题》《指nm给你脸了》</p><h2 id="_20" tabindex="-1">20. <a class="header-anchor" href="#_20" aria-label="Permalink to &quot;20.&quot;">​</a></h2><p>姐妹们有人跟我一样看不懂游戏但是真的很吃我们海鹏的颜吗，蹲蹲</p><h2 id="_21" tabindex="-1">21. <a class="header-anchor" href="#_21" aria-label="Permalink to &quot;21.&quot;">​</a></h2><p>别偶尔秀了一把就歪着你那个b头看弹幕了，这里是互联网，你还有的练呢，菜B</p><h2 id="_22" tabindex="-1">22. <a class="header-anchor" href="#_22" aria-label="Permalink to &quot;22.&quot;">​</a></h2><p>说实话，你不提升自己技术，光靠颜值笼络一批观众，是走不远的</p><h2 id="_23" tabindex="-1">23. <a class="header-anchor" href="#_23" aria-label="Permalink to &quot;23.&quot;">​</a></h2><p>菜成这幅B样，还不每天多打多练，也就长得帅一点，还能吃几年青春饭？</p><h2 id="_24" tabindex="-1">24. <a class="header-anchor" href="#_24" aria-label="Permalink to &quot;24.&quot;">​</a></h2><p>弹幕小心点，主播一直在瞟弹幕，在找软柿子，别怪哥们没提醒</p><h2 id="_25" tabindex="-1">25. <a class="header-anchor" href="#_25" aria-label="Permalink to &quot;25.&quot;">​</a></h2><p>说真的，你真的挺菜的，要不是老天爷赏饭吃给了这张脸，你凭什么直播啊？</p><h2 id="_26" tabindex="-1">26. <a class="header-anchor" href="#_26" aria-label="Permalink to &quot;26.&quot;">​</a></h2><p>我再说一遍，别对主播要求太高，主播不是三头六臂，是一头二臂</p><h2 id="_27" tabindex="-1">27. <a class="header-anchor" href="#_27" aria-label="Permalink to &quot;27.&quot;">​</a></h2><p>老哥们，我多嘴问一句，我可以多嘴问一句吗，如果可以，那我多嘴问一句，我多嘴吗？</p><h2 id="_28" tabindex="-1">28. <a class="header-anchor" href="#_28" aria-label="Permalink to &quot;28.&quot;">​</a></h2><p>有些弹幕真的是目光短浅，看见主播发挥不好就开始嘲笑，等着吧，更好笑的还在后头呢！</p><h2 id="_29" tabindex="-1">29. <a class="header-anchor" href="#_29" aria-label="Permalink to &quot;29.&quot;">​</a></h2><p>本来大家看直播骂一骂主播笑一笑开开心心，结果有人开始刷礼物，搞的直播间乌烟瘴气</p><hr><h2 id="为了不迷路-欢迎来仓库点点-star⭐-欢迎issue-pr进行共建" tabindex="-1">为了不迷路，欢迎来<a href="https://github.com/heygsc/xiaoheihe-literature" target="_blank" rel="noreferrer">仓库</a>点点 star⭐，欢迎issue/pr进行共建 <a class="header-anchor" href="#为了不迷路-欢迎来仓库点点-star⭐-欢迎issue-pr进行共建" aria-label="Permalink to &quot;为了不迷路，欢迎来[仓库](https://github.com/heygsc/xiaoheihe-literature)点点 star⭐，欢迎issue/pr进行共建&quot;">​</a></h2>',61),o=[i];function l(n,d,s,_,c,p){return r(),e("div",null,o)}const q=a(h,[["render",l]]);export{b as __pageData,q as default};
